pragma solidity >=0.6.0 <0.8.0;
pragma abicoder v2;

import "./Wallet.sol";

contract Dex is Wallet {
    enum Side {BUY, SELL}

    struct Order {
        uint256 id;
        address trader;
        bool buyOrder;
        bytes32 ticker;
        uint256 amount;
        uint256 price;
    }

    mapping(bytes32 => mapping(uint256 => Order[])) orderBook;

    function getOrderBook(bytes32 ticker, Side side)
        public
        view
        returns (Order[] memory)
    {
        return orderBook[ticker][uint256(side)];
    }

    function createLimitOrder() public {
        //add order based on price the person wants to buy at
        //we need to ensure the orderbook is sorted:
        //  BUY (highest price first <-> lowest price last)
        //  SELL (highest price first <-> lowest price last)
    }
}
